import React from 'react';
import classes from './myposts.module.css'
import Post from '../../post/post'

let posts = [
  { id: 1, message: 'Hello buddy!', likesCounts: 12 },
  { id: 2, message: 'What is your name?', likesCounts: 12 }
];
let postsElements = posts.map(p => <Post message={p.message} id={p.id} likesCounts={p.likesCounts} />)
const MyPosts = (props) => {
    return (
      <div className={classes.wrapper}>
        <div>
          <h3>My posts</h3> <br></br>
          <textarea className={classes.Areal} placeholder='Start writing...'></textarea>
          <br></br>
          <button>Add Post</button>
        </div>
        <div className={classes.posts}>
          {postsElements}

        </div>
      </div>
    );
}
export default MyPosts;
